    <style>
        body {
            margin: 0;
            padding: 0;
            display: flex;
            align-items: center;
            justify-content: center;
            flex-direction: column;
            height: 100vh;
            background-color: white;
            font-family: Arial, sans-serif;
            overflow: hidden;
        }
        button {
            padding: 15px 30px;
            font-size: 18px;
            color: black;
            background-color: white;
            border: 2px solid black;
            border-radius: 5px;
            cursor: pointer;
            margin-top: 20px;
        }
        button:hover {
            background-color: black;
            color: white;
        }
        #message {
            display: none;
            font-size: 32px;
            color: black;
            font-weight: bold;
            position: absolute;
            top: 10%;
            text-align: center;
            width: 100%;
        }
        #secondButton {
            display: none;
            background-color: green;
            color: white;
            border: none;
            margin: 20px auto 0 auto;
            padding: 10px 20px;
            text-align: center;
        }
        #secondButton:hover {
            background-color: darkgreen;
        }
        #winnerMessage {
            display: none;
            font-size: 24px;
            color: green;
            margin-top: 10px;
            text-align: center;
            animation: blink 1s infinite;
        }
        @keyframes blink {
            0%, 50% {
                opacity: 1;
            }
            25%, 75% {
                opacity: 0;
            }
        }
        .confetti {
            position: absolute;
            width: 10px;
            height: 10px;
            background-color: red;
            opacity: 0.8;
            animation: confetti-fall 3s linear infinite;
        }
        @keyframes confetti-fall {
            0% {
                transform: translateY(-100%) rotate(0deg);
                opacity: 1;
            }
            100% {
                transform: translateY(100vh) rotate(360deg);
                opacity: 0;
            }
        }
        #dancer {
            display: none;
            position: absolute;
            bottom: 5%;
            width: 150px;
            animation: dance 1s infinite alternate;
        }
        @keyframes dance {
            0% { transform: translateX(-10px) rotate(-5deg); }
            100% { transform: translateX(10px) rotate(5deg); }
        }
        #giftBox {
            display: none;
            margin-top: 20px;
            width: 100px;
        }
    </style>

    <script>
        let confettiEndTime = 0;

        function createConfetti() {
            for (let i = 0; i < 100; i++) {
                const confetti = document.createElement('div');
                confetti.classList.add('confetti');
                confetti.style.left = Math.random() * 100 + 'vw';
                confetti.style.backgroundColor = 'hsl(' + Math.floor(Math.random() * 360) + ', 100%, 50%)';
                confetti.style.animationDelay = Math.random() * 2 + 's';
                document.body.appendChild(confetti);
                setTimeout(() => confetti.remove(), 3000);
            }
        }

        function celebrate() {
            const now = Date.now();
            if (now > confettiEndTime) {
                confettiEndTime = now + 10000; // Extend confetti for 10 seconds
                createConfetti();
                const interval = setInterval(() => {
                    if (Date.now() > confettiEndTime) {
                        clearInterval(interval);
                    } else {
                        createConfetti();
                    }
                }, 1000);
            }
            document.getElementById('message').style.display = 'block';
            document.getElementById('dancer').style.display = 'block';
            document.getElementById('birthdayMusic').play();

            setTimeout(() => {
                document.getElementById('secondButton').style.display = 'block';
            }, 2000); // "Ø¨Ø§Ø² Ø´ÙˆØ¯ Ø¯ÛŒØ¯Ù‡ Ø´ÙˆØ¯" button appears after 2 seconds
        }

        function showWinner() {
            document.getElementById('winnerMessage').style.display = 'block';
            document.getElementById('giftBox').style.display = 'block';
        }
    </script>
